  ?epochNumber
  (COUNT(?tx) AS ?totalTxs)
  (SUM(COALESCE(?outputsCount, 0)) AS ?totalOutputs)
WHERE {
  ?block a b:Block ;
    b:hasTx ?tx ;
    c:hasEpoch ?epoch .

  ?epoch c:hasEpochNumber ?epochNumber .
  OPTIONAL { ?tx c:hasTxOutputCount ?outputsCount . }
}
GROUP BY ?epochNumber
ORDER BY ?epochNumber

